import React from "react";
import DeleteIcon from '@mui/icons-material/Delete';

const ToDo = (props)=>{
    return(
        <>
        <div >
         
         <li> <button id="listB" className='btn_align' onClick={()=>{
            props.onselect(props.id)
         }}><DeleteIcon/></button> {props.text}</li> <br/>
        
       
        </div>

        </>
    )
}

export default ToDo;
